const Calculator = () => {
  return (
    <>
      <div className="grid place-item-center h-full place-content-center">
        <div className="bg-[#000] w-60 h-96 rounded-xl">
          <h1 className="text-white sm:text-4xl font-bold bg-green-900 p-2">
            Calculator
          </h1>
          <input
            type="text"
            className="w-full mt-1 h-16 rounded-xl"
            value="0"
          />
        </div>

        <div></div>
      </div>
    </>
  );
};

export default Calculator;
